package ejemplos;

import java.io.*;
import java.util.Base64;

public class BinaryToPDF {

	public static void main(String[] args) throws IOException {
		// TODO Auto-generated method stub
		String texto = "";
		//escribePdf(texto, "PDF");
		prueba(texto);
	}
	
	public static void escribePdf(String texto, String rutaSalida) throws IOException{

	    byte[] biteToRead = texto.getBytes();
	    InputStream is = new ByteArrayInputStream(biteToRead );
	    DataOutputStream out = new DataOutputStream(new  BufferedOutputStream(new FileOutputStream(new File(rutaSalida))));
	    int c;
	    while((c = is.read()) != -1) {
	        out.writeByte(c);
	    }
	    out.close();
	    is.close();

	}
	
	public static void prueba(String text) throws IOException{
		// Get bytes, most important part
		System.out.println("Empieza");
		byte[] bytes = Base64.getDecoder().decode(text);
		// Write to file
		DataOutputStream os = new DataOutputStream(new FileOutputStream("output.pdf"));
		os.write(bytes);
		os.close();
		System.out.println("Termina");
	}

}
